import React from 'react'
import { ToDo } from './ToDo'

export const TableToDo = (props) => {
    let { todos } = props
    return (
        <div>
            {todos.map((el, index) => {
                return (
                    <ToDo el={el} index={index} />
                )
            })}
        </div>
    )
}
